import React from "react";
import { Link, Route, Switch } from "react-router-dom";
import About from "./About";
function Heroheader() {
  return (
    <>
      <section className="container col-2-herro-header">
        <nav>
          <Switch>
            <ul className="main_links">
              <li>
                <Route path="/about">About the Company</Route>
              </li>

              <li>
                <Route path="#">Product Gallery</Route>
              </li>
              <li>
                <Route path="/rating">Ratings & Reviews</Route>
              </li>
            </ul>
          </Switch>
        </nav>
      </section>
      <About />
    </>
  );
}
export default Heroheader;
